import React from 'react';

function VideoGrid (props) {
  const videoList = props.videoList
  let inputVideoList = videoList.map((video) =>
  <div className="video" key={video}>
    <div>
      {video[0]}
    </div>
    <div>
      {video[1]}
    </div>
    <div>
      {video[2]}
    </div>
  </div>)
  return (
      <div >
      {props.inputSearchQuery &&
        <div className="videoList">
          <div className="image">{props.listVideos[0]}</div>
          <div className="name">{props.videoName}</div>
          <div className="chanel">{props.videoTittle}</div>
        </div>
      }
      </div>
  )
}

export default VideoGrid
